import React, { useState } from 'react';
import classes from './IdintetyList.module.css';

const IdintetyList = (props) => {
  const [idUsers, setIdUsers] = useState();

  const deleteHandeler = () => {
    const newHobby = props.idintetyInfo.filter((iden) => iden.hobbies);
    setIdUsers(newHobby);
    // props.onDelete(id);
    // console.log(id);
    // console.log(props.idintetyInfo[0].name);

    // for (const key in props.idintetyInfo) {
    //   const allIds = props.idintetyInfo[key]._id;
    //   setIdUsers(allIds);
    // }
    console.log(idUsers);
  };
  return (
    <section>
      {props.idintetyInfo.map((info) => (
        <div className={classes.list_group}>
          <h1>{info.name}</h1>
          <h2>{info.age}</h2>
          <h2>{info.hobbies}</h2>
          <p> {info._id}</p>
          <div className={classes.list_action}>
            <button onClick={deleteHandeler} className={classes.danger}>
              delete
            </button>
            <button className={classes.primary}>edit</button>
          </div>
        </div>
      ))}
    </section>
  );
};

export default IdintetyList;
